// Helper functions //
const getCenteredX = (doc, text) => {
    const pageWidth = doc.internal.pageSize.getWidth();
    const textWidth = doc.getTextWidth(text);
    return (pageWidth - textWidth) / 2;
}
const reverseString = (str) => {
    if (str) {
        return str.split("").reverse().join("");
    }
}
const checkPageOverflow = (currentY, doc) => {
    const pageHeight = doc.internal.pageSize.getHeight() - 10;  // The `-10` is a margin, adjust as needed
    if (currentY >= pageHeight) {
        doc.addPage();
        return 10;  // This resets the Y-coordinate to the top of the new page, adjust as needed
    }
    return currentY;
};

export default generatePDF;